import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <BrowserRouter>
     <Routes>
        <Route path='/' element={<index/>}/>
        <Route path='/write' element={<Write/>}/>
     </Routes>
    </BrowserRouter>
  )
}

export default App;
